#' Group Co-occurrence Network Analysis
#'
#' 
#' @param data .
#' @param buildModel_variables_long_action The column containing the
#'   actions/states/events to analyze. Each unique value becomes a node in the
#'   co-occurrence network.
#' @param buildModel_variables_long_actor The column identifying
#'   individuals/actors. Used to separate sequences by person.
#' @param buildModel_variables_long_time Timestamp column for ordering events
#'   chronologically. Use this OR Order, not both.
#' @param buildModel_variables_long_order Numeric column indicating the
#'   sequence position of each event. Use this OR Time, not both.
#' @param buildModel_variables_long_group The column defining groups for
#'   comparison (e.g., treatment vs control). A separate co-occurrence network
#'   will be built for each group.
#' @param buildModel_scaling .
#' @param buildModel_show_matrix .
#' @param buildModel_threshold .
#' @param buildModel_show_plot .
#' @param buildModel_plot_cut .
#' @param buildModel_plot_min_value .
#' @param buildModel_plot_edge_label_size .
#' @param buildModel_plot_node_size .
#' @param buildModel_plot_node_label_size .
#' @param buildModel_plot_layout .
#' @param buildModel_show_histo .
#' @param buildModel_show_frequencies .
#' @param centrality_loops .
#' @param centrality_normalize .
#' @param centrality_show_table .
#' @param centrality_show_plot .
#' @param centrality_Betweenness .
#' @param centrality_BetweennessRSP .
#' @param centrality_Closeness .
#' @param centrality_ClosenessIn .
#' @param centrality_ClosenessOut .
#' @param centrality_Clustering .
#' @param centrality_Diffusion .
#' @param centrality_InStrength .
#' @param centrality_OutStrength .
#' @param community_methods .
#' @param community_gamma .
#' @param community_show_plot .
#' @param community_show_table .
#' @param cliques_size .
#' @param cliques_threshold .
#' @param cliques_show_text .
#' @param cliques_show_plot .
#' @param cliques_plot_cut .
#' @param cliques_plot_min_value .
#' @param cliques_plot_edge_label_size .
#' @param cliques_plot_node_size .
#' @param cliques_plot_node_label_size .
#' @param cliques_plot_layout .
#' @param bootstrap_iteration .
#' @param bootstrap_level .
#' @param bootstrap_method .
#' @param bootstrap_range_low .
#' @param bootstrap_range_up .
#' @param bootstrap_threshold .
#' @param bootstrap_show_table .
#' @param bootstrap_table_max_rows .
#' @param bootstrap_table_show_all .
#' @param bootstrap_table_significant_only .
#' @param bootstrap_show_plot .
#' @param bootstrap_plot_cut .
#' @param bootstrap_plot_min_value .
#' @param bootstrap_plot_edge_label_size .
#' @param bootstrap_plot_node_size .
#' @param bootstrap_plot_node_label_size .
#' @param bootstrap_plot_layout .
#' @param permutation_show_text .
#' @param permutation_show_plot .
#' @param permutation_iter .
