        compare_network_diff_plot_node_label_size = compare_network_diff_plot_node_label_size,
        compare_network_diff_plot_layout = compare_network_diff_plot_layout)

    analysis <- GroupCoOccurrenceTNAClass$new(
        options = options,
        data = data)

    analysis$run()

    analysis$results
}

